import React from "react";
import Auth from "../../auth/auth.js";

const auth = new Auth();
const LoginContainer = () => {
  const { isAuthenticated, login, logout, renewSession } = auth;

  return (
    <div>
      <p>Hey</p>
      <button
        onClick={() => {
          login();
        }}
      >
        Login
      </button>
      <button
        onClick={() => {
          logout();
        }}
      >
        Logout
      </button>
    </div>
  );
};

export default LoginContainer;
